import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import { DietListPage, AllTheMenusPage } from './pages';
import { Header } from './components';

function App() {
  return (
    <Router>
      <Header />
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/diet-list">To Diet List</Link>
            </li>
            <li>
              <Link to="/all-the-menus">All the menus</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/diet-list">
            <DietListPage />
          </Route>
          <Route path="/all-the-menus">
            <AllTheMenusPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
